import React from "react";
import "../App.css";
import { Tabs, TabList, Tab } from '@chakra-ui/react'
import { extendTheme } from "@chakra-ui/react";

// Extend the default Chakra UI theme with your custom styles
const theme = extendTheme({
  components: {
    Tabs: {
      baseStyle: {
        tab: {
          _hover: {
            textDecoration: "underline",
            textdecorationthickness: "3px",
            textDecorationColor: "black", 
            transition: "text-decoration ease 3s"
        },
      },
    },
  },
}});

function HeaderBar() {
    return (
      <span>
        <Tabs align="start" position="absolute" variant="unstyled">
          <TabList>
          <Tab>Khyle Dhanani's Personal Website!</Tab>
          </TabList>
        </Tabs>
        <Tabs align="end" position="relative"  variant="unstyled" theme={theme}>
          <TabList>
            <Tab>About</Tab>
            <Tab>Projects</Tab>
            <Tab>Resume</Tab>
            <Tab>Github</Tab>
          </TabList>
        </Tabs>
      </span>
    );
    }

export default HeaderBar;
